import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import '../SignStyle.css';


export class SignUp extends Component {




    constructor(props) {
        super(props);
        this.state = {
            fields: {
                email: "",
                verify_email: "",
                password: "",
                verify_password: ""
            },
            errors: {}
        };
    }









    onChangeEmail = (Email) => {
        this.setState({email : Email.target.value})
    }

    render() {
        return (
            <div>
                <div className="wrapper fadeInDown mt-5 pt-5">
                    <div id="formContent">
                        <h2 className="active signh2"> Sign Up </h2>

                        <div className="fadeIn first mt-2 mb-2">
                            <i className="fa-solid fa-user fa-6x"></i>
                        </div>


                        <form action="/Dashboard" method="GET" >
                            <input
                                type="email"
                                name="email"
                                placeholder="Email adress"
                                onChange={this.onChangeEmail}
                            />
                            

                            <input
                                type="email"
                                name="verify_email"
                                placeholder="Email adress"
                            />

                            <input
                                type="password"
                                name="password"
                                placeholder="Password"
                            />

                            <input
                                type="password"
                                name="verify_password"
                                placeholder="Verify Password"
                            />
                            

                            <button type="submit" className="btn btn-primary disabled" value="Sign Up" />
                        </form>

                        <div id="formFooter">
                            <Link className="underlineHover" to="/login">Already a member ?</Link>
                        </div>

                    </div>
                </div></div>
        )
    }
}

export default SignUp
